(2734, 1, 1, 213, 4, 4, 4, 3, 3, 3, 4, 3, 4, 4, 3, 3, 3, 3, 3, 3, 3, 4, 3, 3, 3, 3, 4, 3, 3, 3, 4, 4, 3, 3, 'jonnamae2003@gmail.com', 'She\'s a good teacher to be honest. She\'s good when it comes to disciplining her students. I just want to suggest that maybe next time she will be more approachable to her students and maybe minimize her what we call \"pilosopa\" attitude because i think majority of my classmates can noticed that attitude of her. Like, when we ask her a question sometimes she just answered \"what do you think?\" or \"it\'s up to you\". I think that in this statement of her could discourage a student. So far that\'s all I can say. But she really has a pure heart. There are just some time we can\'t understand her but I know we were just human we make mistakes. Maybe she just have a problem in her home or in anything . ', 'Jonna Mae S. Cañete ', 'BSBA-1C ', '1/13/2023 18:59'),
