(4387, 1, 1, 240, 4, 4, 4, 4, 4, 3, 5, 5, 5, 5, 5, 3, 4, 5, 4, 5, 4, 4, 3, 3, 5, 4, 3, 3, 4, 4, 4, 5, 4, 3, 'norielanbenitez@gmail.com', 'Ma\'am, you did your job very well.  In fact, you are my most unforgettable teacher I ever had in my entire life. However, your standards are too high to achieve. We\'re just students but your expectations towards us were like regular professionals. You also don\'t want  to listen our whole speech. You are fond of interrupting us while we are speaking our minds and when you give advises and comments, they can really kill us inside, especially those who have weak hearts and problematic ones.', 'Noriel An Benitez ', 'BSED-ENGLISH;2YR.', '1/13/2023 21:50'),
