INSERT INTO `tbl_questions` (`que_id`, `que_desc`) VALUES
(1, 'Teacher is prepared for class.'),
(2, 'Teacher knows his/her subject.'),
(3, 'Teacher is organized and neat.'),
(4, 'Teacher plans class time and assignments that help students solve problem and thick critically'),
(5, 'Teacher provides activities that make subject matter meaningful.'),
(6, 'Teacher is flexible in accommodating individual needs.'),
(7, 'Teacher is clear in giving directions and on explaining what is expected on assignment and tests.'),
(8, 'Teacher allows you to be active in the class learning environment.'),
(9, 'Teacher manages the time well.'),
(10, 'Teacher returns homework in timely manner.'),
(11, 'Teacher has a clear classroom procedure so students don’t waste time.'),
(12, 'Teacher grades fairly.'),
(13, 'I have learned a lot from this teacher about this subject.'),
(14, 'Teacher gives me good feedback on homework and projects so I can improve.'),
(15, 'Teacher is creative in developing activities and lessons.'),
(16, 'Teacher encourages students to speak up and be active in class.'),
(17, 'Teacher follows through what he says.'),
(18, 'You can count on the teacher\'s word.'),
(19, 'Teacher listens and understands student’s point of view; he/she may not agree but students feel understood.'),
(20, 'Teacher respects the opinions and decisions of students.'),
(21, 'Teacher is willing to accept responsibility for his/her own mistakes.'),
(22, 'Teacher is willing to learn from students.'),
(23, 'Teacher is sensitive to the needs of students.'),
(24, 'Teacher\'s words and action match.'),
(25, 'Teacher is fun to be with.'),
(26, 'Teacher helps you when you ask for help.'),
(27, 'Teacher is consistent and fair in discipline.'),
(28, 'I trust this teacher.'),
(29, 'Teacher tries to model what he/she expects from students.'),
(30, 'Teacher is fair and firm in the discipline without being so strict.');
